import { useState} from "react";
import Form from 'react-bootstrap/Form';
import data from "../data.js";

let [answer, setAnswer] = useState();

function Main (){

    return(
    <div>
    <h1>스트레스 자가 진단</h1>
    <br/>
    {
    data.map(function(test){
        return(
            <div style={{whiteSpace : 'pre-wrap'}}> 
            <h4 style={{fontWeight : "600"}}>{test.id}. {test.text}</h4>
            <br/>
            <h4 >
            <Form>
      {[ 'radio'].map((type) => (
        <div className="mb-3">
          <Form.Check 
            inline
            name="myRadioGroup"
            type={type}
            // id={`inline-${type}-1`}
          />전혀
          <Form.Check
            inline
            name="myRadioGroup"
            type={type}
          />가끔
          <Form.Check
            inline
            type={type}
            name="myRadioGroup"
          />거의
            <Form.Check
            inline
            type={type}
            name="myRadioGroup"
          />자주
          <Form.Check
            inline
            type={type}
            name="myRadioGroup"
          />매우자주
        </div>
      ))}
    </Form>
          </h4>
          <br/>

          </div>
        )
        
      })}
      <button>다음</button>
      
    </div>
    )
}

export default Main;
